    return (
        <div className="Main">  
        <Card sx={{ m: 15 }}>

                <Typography sx={{mt: 5}}>
                   הזן מספר טלפון לבדיקה
                </Typography>

            <CardContent>
        <TextField
         fullWidth 
         onChange={setPhone(value)} 
         variant="filled" />
        <Button sx={{ m: 3 }} variant="contained" color="primary"> בדיקה במאגר</Button>
        </CardContent>
        </Card>
        </div>
    );
}

export default Main;
